### **Step 1: Set Up Your Project Structure**

1. Create a new folder for your project (e.g., `dummy-data-app`).
2. Inside this folder, create two subfolders:
   - `backend` (for your Node.js/Express server)
   - `frontend` (for your React application)

```
dummy-data-app/
├── backend/
└── frontend/
```

---

### **Step 2: Set Up the Backend (Node.js/Express)**

1. Navigate to the `backend` folder and initialize a new Node.js project:

```bash
cd dummy-data-app/backend
npm init -y
```

2. Install the required dependencies:

```bash
npm install express mongoose cors dotenv
```

3. Create a new file called `server.js` in the `backend` folder:

```javascript
// backend/server.js
const express = require('express');
const mongoose = require('mongoose');
const cors = require('cors');
const dotenv = require('dotenv');

dotenv.config();

const app = express();
const PORT = process.env.PORT || 5000;

// Middleware
app.use(cors());
app.use(express.json());

// Connect to MongoDB
mongoose.connect(process.env.MONGODB_URI)
  .then(() => console.log('Connected to MongoDB'))
  .catch(err => console.error('MongoDB connection error:', err));

// Routes
