So, static variables. I think when you declare a variable as static inside a function, it retains its value between function calls. That means if I have a function that increments a counter each time it's called, using a static variable would remember the previous value. For example:

void func() {
    static int count = 0;
    count++;
    printf("%d\n", count);
}

Each call to func() would print 1, 2, 3, etc. So static variables inside a function have static storage duration, meaning they exist for the entire program once initialized.

